window.bookSummaryJSON = "<p><b>Secrets destroy relationships, and Loki and I have too many.</b></p> <p>They aren’t the only barrier between us. The Bride Trials has turned on me, and the blood contract demands I murder my fated mate.</p> <p>As I race to find the hellfire crown to prove I’m meant to be the queen of the underworld, the king turns to the dark side, at the risk of losing himself and his wolf to keep me alive.</p> <p>To win this treacherous game, we’ll have to throw all our cards on the table and bare our souls. And, even that might not be enough if we’re pawns, instead of becoming the masters of our own fates.</p>"; 
